- input: "TEXT\x1CC00004440\x1CSB21B.5256.TEXT\x1CSB21B.5256\x1CSB21B\x1COn 11/25/08,
    general journal entry dated 12/31/01 was discovered. The entry included outstanding
    checks prior to 2001 in the total amount of $8100. Details of the checks are as
    follows: #6 - Jaime Espanza $1000, #16 - Robert Jarvis $1500, #1028 - Ken Mayfield
    $1500, #1000 - Texas Ethics Commission $100, #1002 - Billy Joe McCoy $1000, #1047
    - Velleta Lill $2000, #1052 - Velleta Lill $500, and #1060 Don Hill $500. Upon
    review of the transaction history, those checks were found to still have not yet
    cleared the bank. Further research indicated that the checks were voided in the
    past, some later re-issued. Journal entry was then made to write off stale checks.
    Per FEC representative, Julie, inorder to report voided check, it must be entered
    in same line item in prior report as a negative amount to indicate that the check
